using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;



namespace P_ConvertirVarBinary_Archivo
{
    class Program
    {
        static void Main(string[] args)
        {
            String sBinary = "";

            byte[] bByte = new byte[sBinary.Length / 2];

            for (int i = 0; i < bByte.Length; i ++)
            {
                bByte[i] = Convert.ToByte("0x" + sBinary.Substring(i*2, 2), 16);
            
            
            
            }

            System.IO.File.WriteAllBytes("PAXCrypto.dll", bByte);
        }
    }
}
